			private void SetupDefaultAddressSpace()
			{
				// References, i=31, TypeGenerator.AddressSpaceGenerator+NodeReferenceType
				//	HasSubtype/45 -> NonHierarchicalReferences/32
				//	HasSubtype/45 -> HierarchicalReferences/33
				var ID_i31_References = new NodeReferenceType(new NodeId(31), new QualifiedName("References"), new LocalizedText("References"), new LocalizedText("The abstract base type for all references."), 0, 0, true, false, new LocalizedText("References"));
				ID_i31_References.References.Add(new ReferenceNode(new NodeId(45), new NodeId(32), false));
				ID_i31_References.References.Add(new ReferenceNode(new NodeId(45), new NodeId(33), false));

				// NonHierarchicalReferences, i=32, TypeGenerator.AddressSpaceGenerator+NodeReferenceType
				//	HasSubtype/45 <- References/31
				//	HasSubtype/45 -> HasModellingRule/37
				//	HasSubtype/45 -> HasEncoding/38
				//	HasSubtype/45 -> HasDescription/39
				//	HasSubtype/45 -> HasTypeDefinition/40
				//	HasSubtype/45 -> GeneratesEvent/41
				//	HasSubtype/45 -> AlwaysGeneratesEvent/3065
				//	HasSubtype/45 -> FromState/51
				//	HasSubtype/45 -> ToState/52
				//	HasSubtype/45 -> HasCause/53
				//	HasSubtype/45 -> HasEffect/54
				//	HasSubtype/45 -> HasSubStateMachine/117
				//	HasSubtype/45 -> HasTrueSubState/9004
				//	HasSubtype/45 -> HasFalseSubState/9005
				//	HasSubtype/45 -> HasCondition/9006
				var ID_i32_NonHierarchicalReferences = new NodeReferenceType(new NodeId(32), new QualifiedName("NonHierarchicalReferences"), new LocalizedText("NonHierarchicalReferences"), new LocalizedText("The abstract base type for all non-hierarchical references."), 0, 0, true, false, new LocalizedText("NonHierarchicalReferences"));
				ID_i32_NonHierarchicalReferences.References.Add(new ReferenceNode(new NodeId(45), new NodeId(31), true));
				ID_i32_NonHierarchicalReferences.References.Add(new ReferenceNode(new NodeId(45), new NodeId(37), false));
				ID_i32_NonHierarchicalReferences.References.Add(new ReferenceNode(new NodeId(45), new NodeId(38), false));
				ID_i32_NonHierarchicalReferences.References.Add(new ReferenceNode(new NodeId(45), new NodeId(39), false));
				ID_i32_NonHierarchicalReferences.References.Add(new ReferenceNode(new NodeId(45), new NodeId(40), false));
				ID_i32_NonHierarchicalReferences.References.Add(new ReferenceNode(new NodeId(45), new NodeId(41), false));
				ID_i32_NonHierarchicalReferences.References.Add(new ReferenceNode(new NodeId(45), new NodeId(3065), false));
				ID_i32_NonHierarchicalReferences.References.Add(new ReferenceNode(new NodeId(45), new NodeId(51), false));
				ID_i32_NonHierarchicalReferences.References.Add(new ReferenceNode(new NodeId(45), new NodeId(52), false));
				ID_i32_NonHierarchicalReferences.References.Add(new ReferenceNode(new NodeId(45), new NodeId(53), false));
				ID_i32_NonHierarchicalReferences.References.Add(new ReferenceNode(new NodeId(45), new NodeId(54), false));
				ID_i32_NonHierarchicalReferences.References.Add(new ReferenceNode(new NodeId(45), new NodeId(117), false));
